CREATE TABLE `car` (
  `PlateId` int(11) NOT NULL,
  `CarName` varchar(225) NOT NULL,
  `Overview` varchar(225) NOT NULL,
  `PricePerDay` int(11) NOT NULL,
  `Year` year(4) NOT NULL,
  `Image` longblob NOT NULL,
  `DriverAirbag` char(1) NOT NULL,
  `Air_conditioner` char(1) NOT NULL,
  `Seating_capacity` int(11) NOT NULL,
  `Color` varchar(225) NOT NULL,
  `OId` int(11) NOT NULL,
  `Status` varchar(225) NOT NULL,
  `brandName` varchar(30) DEFAULT NULL,
  `category` varchar(30) DEFAULT NULL
);

CREATE TABLE `offices` (
  `OId` int(11) NOT NULL,
  `Country` varchar(50) NOT NULL
);

CREATE TABLE `reservation` (
  `Reservation_number` int(11) NOT NULL,
  `SSN` char(11) NOT NULL,
  `PlateId` int(11) NOT NULL,
  `pickup_date` date NOT NULL,
  `return_date` date NOT NULL,
  `Payment_method` varchar(225) DEFAULT NULL,
  `Total_price` int(11) NOT NULL
);

CREATE TABLE `users` (
  `SSN` char(11) NOT NULL,
  `FirstName` varchar(120) NOT NULL,
  `LastName` varchar(120) NOT NULL,
  `Email` varchar(100) NOT NULL,
  `Password` varchar(100) NOT NULL,
  `ContactNo` char(11) NOT NULL,
  `dob` date NOT NULL,
  `Address` varchar(255) NOT NULL,
  `City` varchar(100) NOT NULL,
  `Country` varchar(100) NOT NULL,
  `admin` tinyint(1) DEFAULT 0
);





ALTER TABLE `car`
  ADD PRIMARY KEY (`PlateId`),
  ADD KEY `OId` (`OId`),
  ADD KEY `car_ibfk_2` (`CarName`);


ALTER TABLE `offices`
  ADD PRIMARY KEY (`OId`);


ALTER TABLE `reservation`
  ADD PRIMARY KEY (`Reservation_number`),
  ADD KEY `SSN` (`SSN`),
  ADD KEY `fk_name` (`PlateId`);


ALTER TABLE `users`
  ADD PRIMARY KEY (`SSN`),
  ADD UNIQUE KEY `Email` (`Email`),
  ADD UNIQUE KEY `ContactNo` (`ContactNo`);


ALTER TABLE `offices`
  MODIFY `OId` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=66;


ALTER TABLE `reservation`
  MODIFY `Reservation_number` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=70;


ALTER TABLE `car`
  ADD CONSTRAINT `car_ibfk_1` FOREIGN KEY (`OId`) REFERENCES `offices` (`OId`);


ALTER TABLE `reservation`
  ADD CONSTRAINT `fk_name` FOREIGN KEY (`PlateId`) REFERENCES `car` (`PlateId`) ON DELETE CASCADE,
  ADD CONSTRAINT `reservation_ibfk_1` FOREIGN KEY (`SSN`) REFERENCES `users` (`SSN`),
  ADD CONSTRAINT `reservation_ibfk_2` FOREIGN KEY (`PlateId`) REFERENCES `car` (`PlateId`);
